import 'dart:convert';

class InDemand {
	String? id;
	String? productName;
	String? price;
	String? imageUrl;

	InDemand({this.id, this.productName, this.price, this.imageUrl});

	factory InDemand.(Map<String, dynamic> data) {
		return InDemand(
			id: data['id'] as String?,
			productName: data['productName'] as String?,
			price: data['price'] as String?,
			imageUrl: data['image-url'] as String?,
		);
	}



	Map<String, dynamic> () {
		return {
			'id': id,
			'productName': productName,
			'price': price,
			'image-url': imageUrl,		};
	}

  /// `dart:convert`
  ///
  /// Parses the string and returns the resulting Json object as [InDemand].
	factory InDemand.fromJson(String data) {
		return InDemand.(json.decode(data) as Map<String, dynamic>);
	}
  /// `dart:convert`
  ///
  /// Converts [InDemand] to a JSON string.
	String toJson() => json.encode(());
}
